            { name: 'Chiayi County', top: '54vw', left: '51vw', show: false, path: 'data:image/png;base64,' },
            { name: 'Chiayi', top: '54vw', left: '47vw', show: false, path: 'data:image/png;base64,' },
            { name: 'Kaohsiung', top: '70vw', left: '50vw', show: false, path: 'data:image/png;base64,' },
            { name: 'Taitung', top: '70vw', left: '62vw', show: false, path: 'data:image/png;base64,' },
            { name: 'Hualien', top: '45vw', left: '73vw', show: false, path: 'data:image/png;base64,' },
            { name: 'Pingtung', top: '80vw', left: '51vw', show: false, path: 'data:image/png;base64,' },
            { name: 'Yilan', top: '24vw', left: '78vw', show: false, path: 'data:image/png;base64,' },
        ],
        icons: [
            'mdi-facebook',
            'mdi-twitter',
            'mdi-linkedin',
            'mdi-instagram',
        ],
        qrcode: '',
        selectedHotspot: "",
        selectedName: "",
        showMain: true,
        showSigup: false,
        showLogin: false,
        showsubpage: false,
        agreement: false,
        dialog: false,
        isValid: false,
        isLoading: false,
        phone: '',
        advanced_info:false,
        formData: {
            email: '',
            phone: '',
            password: ''
        },
        loginfailmes: false,
        rules: {
            email: v => !!(v || '').match(/@/) || 'Please enter a valid email',
            length: len => v => (v || '').length >= len || `Invalid character length, required ${len}`,
            password: v => !!(v || '').match(/^(?=.*[a-z])(?=.*[A-Z])(?=.*\d)(?=.*(_|[^\w])).+$/) ||
                'Password must contain an upper case letter, a numeric character, and a special character',
            required: v => !!v || 'This field is required',
        },
        value: {
            type: String,
            default: `http://localhost:8080/`
        }
    }),
    methods: {
        onClickImage(hotspot) {
            alert(`${hotspot.name}`);
        },
        getImageStyle(image) {
            // 動態生成 style 對象，包含 top 和 left 屬性的值
            return {
                position: 'absolute',
                top: image.top,
                left: image.left,
                width: image.width,
                height: image.height
            };
        },
        handleSignup() {
            // 在按下登入按鈕後觸發，控制顯示和隱藏
            this.showMain = false; // 隱藏圖片
            this.showSigup = true; // 顯示登入介面
            this.showLogin = false;
            this.showsubpage = false;
        },
        handleBackToMain() {
            // 在按下返回按鈕後觸發，切換回圖片主頁面
            this.showMain = true; // 顯示圖片
            this.showSigup = false; // 隱藏登入介面
            this.showLogin = false;
            this.showsubpage = false;
        },
        handleLogin() {
            // 在按下登入按鈕後觸發，控制顯示和隱藏
            this.showMain = false; // 隱藏圖片
            this.showLogin = true; // 顯示登入介面
            this.showSigup = false;
            this.showsubpage = false;
        },
        handleSubpage(hotspot) {
            this.showMain = false; // 隱藏圖片
            this.showLogin = false; // 顯示登入介面
            this.showSigup = false;
            this.showsubpage = true;
            this.selectedHotspot = hotspot.path;
            this.selectedName = hotspot.name;
        },
        // async loginWithGoogle() {
        //     try {
        //         await this.$gAuth.signIn();
        //         // 登入成功，可以進行後續操作
        //     }
        //     catch (error) {
        //         console.error('Google 登入失敗', error);
        //     }
        // },
        handleSubmit() {
            // 使用 axios.post 來發送 POST 請求
            axios.post('http://localhost:8081/Registers', this.formData)
                .then(response => {
                console.log('Registration successful:', response.data);
                if (response.data.message == 'Registration successful') {
                    this.loginSuccess = true;
                    this.loginfailmes = false;
                    this.showSigup=false;
                    this.showMain = true;
                    this.advanced_info=true;
                }
            })
                .catch(error => {
                console.error('Registration failed:', error);
                // 在這裡可以處理失敗的操作，例如顯示錯誤訊息
            });
        },
        login() {
            axios.post('http://localhost:8081/login', this.formData)
                .then(response => {
                // 登入成功，您可以在這裡處理相應的操作
                if (response.data.message == 'Login successful') {
                    this.loginSuccess = true;
                    this.loginfailmes = false;
                    this.showMain = true;
                    this.advanced_info=true;
                }
            })
                .catch(error => {
                // 登入失敗，您可以在這裡處理相應的錯誤處理
                this.loginfailmes = true;
            });
        },
        async generateAndDownloadQRCode() {
            const text = window.location.href; // 當前網址
            const canvas = document.createElement('canvas');
            const context = canvas.getContext('2d');
            // 生成 QR Code
            await QRCode.toCanvas(canvas, text);
            // 將 QR Code 圖片轉換成 URL
            const qrCodeURL = canvas.toDataURL('image/png');
            // 建立一個 <a> 元素，設定屬性並觸發點擊事件下載
            const downloadLink = document.createElement('a');
            downloadLink.href = qrCodeURL;
            downloadLink.download = 'qrcode.png';
            downloadLink.click();
        },
        copyToClipboard() {
            const currentURL = window.location.href;
            // 建立一個虛擬的 textarea 元素
            const textarea = document.createElement('textarea');
            textarea.value = currentURL;
            document.body.appendChild(textarea);
            // 選取並複製內容
            textarea.select();
            document.execCommand('copy');
            // 刪除虛擬元素
            document.body.removeChild(textarea);
            // 顯示提示訊息，或進行其他操作
            alert('已複製當前網址到剪貼簿');
        }
    },
    components: { GoogleLogin }
}
  
</script>
